import { createBrowserRouter } from 'react-router-dom'

import HomePage from './pages/HomePage'


function App() {

  const browser = createBrowserRouter([
    { path: '', element: <HomePage />}
  ])


  return <div>
    <h1>Ciao amici!</h1>
    <p>un po di testo simpatico</p>
    <p>un po di testo antipatico</p>
  </div>;
}

export default App;
